import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';

import ReactDOM from 'react-dom';
import { GoogleLogin } from 'react-google-login';

class signinComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            myThis: this,
            myProps:props
        };
    }


    responseGoogle (response) {
        console.log(response);
        sessionStorage["userName"] = response.profileObj.name;
        sessionStorage["userEmail"] = response.profileObj.email;
        sessionStorage["userUrl"] = response.profileObj.imageUrl;

        myThis.state.myProps.history.push('/crear-perfil'); 
    }

    render() {
        return (
            <div class="container p-4">
                <div class="row">
                    <div class="col-md-4 mx-auto">
                        <div class="card text-center">
                            <div class="card-header">
                                <h1>Iniciar Sesi√≥n</h1>
                            </div>
                            <div class="card-body">
                                <GoogleLogin
                                    clientId="820637070016-genrk31ge28bjg97du1q9bkvsa0p6bdq.apps.googleusercontent.com"
                                    render={renderProps => (
                                        <button className = "btn btn-primary" onClick={renderProps.onClick}>Iniciar sesion</button>
                                    )}
                                    buttonText="Login"
                                    onSuccess={this.responseGoogle}
                                    onFailure={this.responseGoogle}
                                    cookiePolicy={'single_host_origin'}
                                />

                            </div>
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default signinComponent;
